import React, { Component } from 'react'
import axios from 'axios'
import Disposition from './Disposition';

export class Chauffeur_dispo extends Component {
    constructor(props) {
		super(props);

		this.state = {
			chauffeurs: []
		}
    }
    componentDidMount() {
        this.getChauffeurs();
    } 

    action = {
        getChauffeurs: () => {
        axios.get('chauffeurs')
            .then(response => this.setState({
                chauffeurs: response.data
            }))
        },

        deleteChauffeur: (chauffeur) => {
            axios.delete(`chauffeurs/${chauffeur.id}`)
                .then(response => {
                    if (response.status === 204) {
                        this.getChauffeurs();
                    }
                })
        }
    }

    render() {
        console.log(this.state.chauffeurs)
        const chauffeurs = this.state.chauffeurs
        return (
            <div>
                <div class="row">
                    <div class="col-md-12 col-sm-12 ">
                        <div class="x_panel">
                        <div class="x_title">
                            <h2>Default Example <small>Users</small></h2>
                            <ul class="nav navbar-right panel_toolbox">
                            <li><a class="collapse-link"><i class="fa fa-chevron-up"></i></a>
                            </li>
                            <li class="dropdown">
                                <a href="#" class="dropdown-toggle" data-toggle="dropdown" role="button" aria-expanded="false"><i class="fa fa-wrench"></i></a>
                                <div class="dropdown-menu" aria-labelledby="dropdownMenuButton">
                                    <a class="dropdown-item" href="#">Settings 1</a>
                                    <a class="dropdown-item" href="#">Settings 2</a>
                                </div>
                            </li>
                            <li><a class="close-link"><i class="fa fa-close"></i></a>
                            </li>
                            </ul>
                            <div class="clearfix"></div>
                        </div>
                        <div class="x_content">
                            <div class="row">
                                <div class="col-sm-12">
                                    <div class="card-box table-responsive">
                            <p class="text-muted font-13 m-b-30">
                            DataTables has most features enabled by default, so all you need to do to use it with your own tables is to call the construction function: <code>$().DataTable();</code>
                            </p>
                            <table id="datatable" class="table table-striped table-bordered" style={{width: '100%'}}>
                            <thead>
                                <tr>
                                <th>Name</th>
                                <th>Position</th>
                                <th>Office</th>
                                <th>Age</th>
                                <th>Start date</th>
                                <th>Salary</th>
                                </tr>
                            </thead>


                            <tbody>
                                {chauffeurs && chauffeurs.map(chauffeur => {
                                    return (
                                        <Disposition chauffeur={chauffeur} action={{...this.action}}/>
                                    )
                                })}
                                    <tr>
                                        <td>Tiger Nixon</td>
                                        <td>System Architect</td>
                                        <td>Edinburgh</td>
                                        <td>61</td>
                                        <td>2011/04/25</td>
                                        <td>$320,800</td>
                                    </tr>


                            </tbody>
                            </table>
                        </div>
                        </div>
                    </div>
                    </div>
                    </div>
                </div>
              </div>

            </div>
        )
    }
}

export default Chauffeur_dispo
